import React from 'react';
import { useHistory } from 'react-router-dom'; // Import useHistory hook for navigation
import './WelcomePage.css'; // Import CSS file for styling

function WelcomePage() {
  const history = useHistory(); // Initialize useHistory hook

  const goToBlankPage = () => {
    // Navigate to the blank page when button is clicked
    history.push('/blank-page');
  };

  return (
    <div className="welcome-container">
      <h2>Welcome, Ana!</h2>
      <p>You are now logged in.</p>
      <button onClick={goToBlankPage}>Go to Blank Page</button>
    </div>
  );
}

export default WelcomePage;
